import React from 'react';

export default class ViewItems extends React.Component{
    render(){
        let items = this.props.items
        return <div>
            <table>
                <thead>
                    <tr>
                    <th>Task</th>
                    <th>Due date</th>
                    </tr>
                </thead>
                {items.map((item,i)=>{
                return <tbody>
                    <tr>
                    <td>{item.task}</td>
                    <td>{item.duedate}</td>
                    </tr>
                </tbody>
            })}
            </table>
        </div>
    }
}
